INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 7001, "キャル", 1, "2015/12/17 15:00:00", 1, 7, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0, 0.0, 0, -363.0, 106001, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 7002, "コッコロ", 1, "2015/12/17 15:00:00", 1, 7, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0, 0.0, 0, -363.0, 105901, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 7003, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 7, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0, 0.0, 0, -363.0, 105801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 10001, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 10, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0, 0.0, 0, -363.0, 105801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 10002, "キャル", 1, "2015/12/17 15:00:00", 1, 10, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0, 0.0, 0, -363.0, 106001, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 10003, "コッコロ", 1, "2015/12/17 15:00:00", 1, 10, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0, 0.0, 0, -363.0, 105901, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 10004, "シェフィ", 2, "2015/12/17 15:00:00", 1, 10, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 0, 0.0, 2104010, -363.0, 106401, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 12001, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 12, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0, 0.0, 0, -416.5, 105801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 13001, "キャル", 1, "2015/12/17 15:00:00", 1, 13, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0, 0.0, 0, -363.0, 106001, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 13002, "コッコロ", 1, "2015/12/17 15:00:00", 1, 13, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0, 0.0, 0, -363.0, 105901, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 13003, "シェフィ", 2, "2015/12/17 15:00:00", 1, 13, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0, 0.0, 2104010, -363.0, 106401, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 13004, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 13, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0, 0.0, 0, -363.0, 105801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 14001, "コッコロ", 1, "2015/12/17 15:00:00", 1, 14, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0, 0.0, 0, -363.0, 105901, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 14002, "シェフィ", 2, "2015/12/17 15:00:00", 1, 14, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 0, 0.0, 2104010, -363.0, 106401, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 14003, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 14, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0, 0.0, 0, -363.0, 105801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 14004, "キャル", 1, "2015/12/17 15:00:00", 1, 14, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0, 0.0, 0, -363.0, 106001, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 15001, "コッコロ", 1, "2015/12/17 15:00:00", 1, 15, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0, 0.0, 0, -470.0, 105901, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 16001, "シェフィ", 2, "2015/12/17 15:00:00", 1, 16, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0, 0.0, 2104010, -363.0, 106401, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 16002, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 16, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0, 0.0, 0, -363.0, 105801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 16003, "キャル", 1, "2015/12/17 15:00:00", 1, 16, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0, 0.0, 0, -363.0, 106001, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 16004, "コッコロ", 1, "2015/12/17 15:00:00", 1, 16, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0, 0.0, 0, -363.0, 105901, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 17002, "コッコロ", 1, "2015/12/17 15:00:00", 1, 17, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0, 0.0, 0, -363.0, 105901, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 17004, "キャル", 1, "2015/12/17 15:00:00", 1, 25, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0, 0.0, 0, -363.0, 106001, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 17005, "コッコロ", 1, "2015/12/17 15:00:00", 1, 25, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0, 0.0, 0, -363.0, 105901, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 17006, "シェフィ", 2, "2015/12/17 15:00:00", 1, 25, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 0, 0.0, 2104010, -363.0, 106401, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 17007, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 25, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0, 0.0, 0, -363.0, 105801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 18001, "カリン", 1, "2015/12/17 15:00:00", 1, 18, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0, 0.0, 0, -363.0, 190801, 0.0);
