INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 20001, "カリン", 1, "2015/12/17 15:00:00", 5, 20, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0, 0.0, 0, -470.0, 190801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 20002, "カリン", 1, "2015/12/17 15:00:00", 6, 20, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0, 0.0, 0, -470.0, 190801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 21001, "キャル", 1, "2015/12/17 15:00:00", 1, 21, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0, 0.0, 0, -363.0, 106001, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 21002, "コッコロ", 1, "2015/12/17 15:00:00", 1, 21, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0, 0.0, 0, -363.0, 105901, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 21003, "シェフィ", 2, "2015/12/17 15:00:00", 1, 21, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 0, 0.0, 2104010, -363.0, 106401, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 21004, "ペコリーヌ", 1, "2015/12/17 15:00:00", 1, 21, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0, 0.0, 0, -363.0, 105801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 22001, "カリン", 1, "2015/12/17 15:00:00", 1, 22, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0, 0.0, 0, -430.0, 190801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 22002, "カリン", 1, "2015/12/17 15:00:00", 2, 22, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0, 0.0, 0, -430.0, 190801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 23001, "カリン", 1, "2015/12/17 15:00:00", 3, 23, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0, 0.0, 0, -430.0, 190801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 23002, "カリン", 1, "2015/12/17 15:00:00", 4, 23, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0, 0.0, 0, -430.0, 190801, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, "2030/12/17 14:59:59", 24001, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 1, 24, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 10011, 8.0, 0, -385.0, 109001, 4.08);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, "2030/12/17 14:59:59", 24002, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 2, 24, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 10011, 8.0, 0, -385.0, 109001, 5.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, "2030/12/17 14:59:59", 24003, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 3, 24, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 10011, 8.0, 0, -385.0, 109001, 10.11);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, "2030/12/17 14:59:59", 24004, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 4, 24, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 10011, 8.0, 0, -385.0, 109001, 4.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, "2030/12/17 14:59:59", 24005, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 5, 24, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 10011, 8.0, 0, -385.0, 109001, 6.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 24006, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 6, 24, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 10011, 0.0, 0, 0.0, 109002, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 24007, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 7, 24, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 10011, 0.0, 0, 0.0, 109002, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 24008, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 8, 24, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 10011, 0.0, 0, 0.0, 109002, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 24009, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 9, 24, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 10011, 0.0, 0, 0.0, 109002, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 24010, "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", 10, 24, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 10011, 0.0, 0, 0.0, 109002, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, "2030/12/17 14:59:59", 24011, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 1, 24, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 10011, 8.0, 0, -385.0, 109101, 2.12);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, "2030/12/17 14:59:59", 24012, "シズル（バレンタイン）", 5, "2019/01/31 12:00:00", 2, 24, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 10011, 8.0, 0, -385.0, 109101, 4.19);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (4, "2030/12/17 14:59:59", 24013, "シズル（バレンタイン）", 2, "2019/01/31 12:00:00", 3, 24, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 10011, 8.0, 0, -385.0, 109101, 2.3);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 24014, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 4, 24, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 10011, 0.0, 0, 0.0, 109102, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, "2030/12/17 14:59:59", 24015, "シズル（バレンタイン）", 5, "2019/01/31 12:00:00", 5, 24, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 10011, 8.0, 0, -385.0, 109101, 5.23);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 24016, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 6, 24, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 10011, 0.0, 0, 0.0, 109102, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, "2030/12/17 14:59:59", 24017, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 7, 24, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 10011, 8.0, 0, -385.0, 109101, 5.01);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 24018, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 8, 24, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 10011, 0.0, 0, 0.0, 109102, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 24019, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 9, 24, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 10011, 0.0, 0, 0.0, 109102, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 24020, "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", 10, 24, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 10011, 0.0, 0, 0.0, 109102, 0.0);
