INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 43005, "アメス", 1, "2015/12/17 15:00:00", 2, 44, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 0, 0.0, 0, -416.5, 123001, 0.0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2, "2030/12/17 14:59:59", 43006, "アメス", 1, "2015/12/17 15:00:00", 3, 45, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 0, 0.0, 0, -416.5, 123001, 5.79);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, "2030/12/17 14:59:59", 46001, "アメス", 1, "2015/12/17 15:00:00", 1, 46, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 0, 0.0, 0, -371.5, 123001, 0.0);
